    [TestMethod]
    public void TestMethod1()
    {
        var key = new byte[256 / 8];

        var doc = System.Text.Json.JsonDocument.Parse(json);

        var content = doc.RootElement.GetProperty("content").GetString();
        var iv = doc.RootElement.GetProperty("iv").GetString();


        using var aes = Aes.Create();
        aes.Key = Convert.FromBase64String("NYfoPFoLJMDgkz0eaWCFpywAPUtfGog0ieL39bE+RM8=");

        var rawContent = Convert.FromBase64String(content);
        var rawIv = Convert.FromBase64String(iv).Take(16).ToArray();


        var result = aes.DecryptCbc(
            rawContent,
            rawIv);


        Console.WriteLine(System.Text.Encoding.UTF8.GetString(result));
    }

    [TestMethod]
    public async Task ConnectToZyxel()
    {
        using var zx = new ZyxelClient();

        await zx.ConnectAsync();

        Assert.IsTrue(zx.IsAuthorized);


        var r = await zx.ApiCallAsync("cgi-bin/WLANTable_handle");

        Console.WriteLine(r.RootElement.ToString());

        GC.KeepAlive(r);
    }

    [TestMethod]
    public async Task GetLanHosts()
    {
        using var zx = new ZyxelClient();

        await zx.ConnectAsync();

        Assert.IsTrue(zx.IsAuthorized);

        foreach (var lh in (await zx.GetLanHostsAsync()).OrderBy(x => string.Join('.', x.IPAddress?.Split('.').Select(x => x.PadLeft(3, '0')) ?? [])))
        {
            Console.WriteLine(JsonSerializer.Serialize(lh));
        }
    }
